import { Component, OnInit } from '@angular/core';
import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';

const uri = "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyDrenGS6rNycqvDBndJIA2i3wOLr6tgR-s";

const httpOptions = {
  headers: new HttpHeaders({
    'Content-Type': 'application/json'
  })
};

@Component({
  selector: 'app-ocr',
  templateUrl: './ocr.component.html',
  styleUrls: ['./ocr.component.scss']
})

@Injectable()
export class OcrComponent implements OnInit {

  constructor(private http: HttpClient) {
    this.readCode();
  }

  ngOnInit() {
  }

  readCode() {
    var txt = "";


    var body = "{\"requests\":[{\"image\":{\"content\":\"" + txt + "\"},\"features\":[{\"type\":\"TEXT_DETECTION\"}]}]}";

    this.http.post(uri, body, httpOptions)
      .subscribe((data: any) => { console.log(JSON.stringify(data)); });;

  }

}
